import React from 'react';
import classes from './Profile.module.css'
import MyPosts from './MyPosts/MyPosts';

const Profile = () => {
    return (
        <div className={classes.profile}>
        <div>
          <img src="https://www.linuxfoundation.org/wp-content/uploads/2016/12/lf_background_trees.jpg"/>
        </div>
        <div>
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS1rIHEq4QPVPjFKZHCIyM4fGLOZH6x-0jF80NPPjlKHPQPoXdYMA&s"/>
          Descriptions
        </div>
        <MyPosts />
      </div>
    )
}

export default Profile
